static void copy_image
	(
	int source_x,
	int source_y,
	int source_width,
	int source_height,
	int source_buffer_width,
	unsigned int *source_buffer,
	int destination_x,
	int destination_y,
	int destination_buffer_width,
	unsigned int *destination_buffer
	)
	{
	source_buffer      += source_y      * source_buffer_width      + source_x;
	destination_buffer += destination_y * destination_buffer_width + destination_x;


	int source_buffer_add      = source_buffer_width      - source_width;
	int destination_buffer_add = destination_buffer_width - source_width;


	while (source_height != 0)
		{
		int width = source_width;


		while (width != 0)
			{
			destination_buffer[0] = source_buffer[0];

			source_buffer      ++;
			destination_buffer ++;
			width              --;
			}


		source_buffer      += source_buffer_add;
		destination_buffer += destination_buffer_add;
		source_height      --;
		}
	}


static void copy_number(int number, int destination_x, int destination_y, int maximum)
	{
	#define number_width  7
	#define number_height 6


	if (number > maximum)
		{
		number = maximum;
		}

	maximum ++;

	while (maximum != 1)
		{
		maximum /= 10;

		int value = number / maximum;

		number %= maximum;

		copy_image(number_width * value, 0, number_width, number_height, 10 * number_width, (unsigned int *) numbers_8888, destination_x, destination_y, 512, (unsigned int *) background_8888);

		destination_x += number_width;
		}
	}


static void draw_time(unsigned long long frame_number, unsigned long long number_of_frames, unsigned long long scale, unsigned long long rate)
	{
	#define time_x0  4
	#define time_y0  5
	#define time_x1 21
	#define time_y1  5
	#define time_x2 38
	#define time_y2  5
	
	//add by cooleyes 2006/12/11
	#define time_x3  427
	#define time_y3  5
	#define time_x4 444
	#define time_y4  5
	#define time_x5 461
	#define time_y5  5
	//add end 

	unsigned long long seconds = frame_number * scale / rate;
	
	//add by cooleyes 2006/12/11
	unsigned long long all_seconds = number_of_frames * scale / rate;
	//add end

	copy_number(seconds % 60, time_x2, time_y2, 99);
	seconds /= 60;
	copy_number(seconds % 60, time_x1, time_y1, 99);
	seconds /= 60;
	copy_number(seconds,      time_x0, time_y0, 99);
	
	//add by cooleyes 2006/12/11
	copy_number(all_seconds % 60, time_x5, time_y5, 99);
	all_seconds /= 60;
	copy_number(all_seconds % 60, time_x4, time_y4, 99);
	all_seconds /= 60;
	copy_number(all_seconds,      time_x3, time_y3, 99);
	//add end
	
	}


static void draw_progress(unsigned int number_of_frames, unsigned int frame_number)
	{
	#define progress_x      58
	#define progress_y       6
	#define progress_width 361

	#define background_color 0xff000000
	#define foreground_color 0xffffffff

	unsigned int progress = progress_width * frame_number / number_of_frames;

	unsigned int *destination = (unsigned int *) background_8888;

	destination += 512 * progress_y + progress_x;


	unsigned int i = 0;
	for (; i < progress_width; i++)
		{
		if (i > progress)
			{
			destination[0] = background_color;
			}
		else
			{
			destination[0] = foreground_color;
			}

		destination ++;
		}
	}


void draw_interface
	(
	unsigned int scale, 
	unsigned int rate, 
	unsigned int number_of_frames, 
	unsigned int frame_number, 
	unsigned int aspect_ratio, 
	unsigned int zoom,
	unsigned int luminosity_boost,
	unsigned int audio_stream,
	unsigned int volume_boost,
	unsigned int loop
	)
	{
	
	#define luminosity_boost_x 147
	#define luminosity_boost_y  15

	copy_number(luminosity_boost, luminosity_boost_x, luminosity_boost_y, 99);


	#define volume_boost_x 51
	#define volume_boost_y  15

	copy_number(volume_boost, volume_boost_x, volume_boost_y, 99);
	
	#define audio_stream_x 279
	#define audio_stream_y  15

	copy_number(audio_stream + 1, audio_stream_x, audio_stream_y, 9);


	#define loop_x      208
	#define loop_y       15
	#define loop_width   21
	#define loop_height   6

	copy_image(0, loop_height * loop, loop_width, loop_height, loop_width, (unsigned int *) loop_8888, loop_x, loop_y, 512, (unsigned int *) background_8888);

	#define battery_x 354
	#define battery_y  15
	
	int battery_life = scePowerGetBatteryLifePercent();
	if ( (battery_life < 0) || (battery_life > 100) )
		battery_life = 0;
	//battery_life = scePowerGetCpuClockFrequency();
	copy_number(battery_life, battery_x, battery_y, 999);
	
	#define time_h_x 427
	#define time_h_y 15
	#define time_m_x 444
	#define time_m_y 15
	#define time_s_x 461
	#define time_s_y 15
	pspTime current_time;
	sceRtcGetCurrentClockLocalTime(&current_time);
	copy_number(current_time.hour, time_h_x, time_h_y, 99);
	copy_number(current_time.minutes, time_m_x, time_m_y, 99);
	copy_number(current_time.seconds, time_s_x, time_s_y, 99);

	//modify by cooleyes 2006/12/11
	//draw_time(frame_number, scale, rate);
	draw_time(frame_number, number_of_frames, scale, rate);
	//modify end
	draw_progress(number_of_frames, frame_number);
	}
